    name: e_cov_2_2
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.error_flag'
    datatype: int
    description: A flag describing potential problems with the shear estimate. Only
      objects with ERROR_FLAG == 0 should be used for any scientific analysis.
    name: error_flag
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.snr_w'
    datatype: float
    description: The standard optimal weight S/N estimate. See Section 7.1 of Jarvis
      et al, 2015 for an explanation of the differences between SNR_W and SNR_R estimates.
      In particular, it is recommended that any selection involving S/N beyond the
      cuts we have already applied should use SNR_W, not SNR_R. (This is different
      for im3shape!)
    name: snr_w
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.snr_r'
    datatype: float
    description: The roundified S/N estimate. See Section 7.1 of Jarvis et al, 2015
      for an explanation of the differences between SNR_W and SNR_R estimates. In
      particular, it is recommended that any selection involving S/N beyond the cuts
      we have already applied should use SNR_W, not SNR_R. (This is different for
      im3shape!)
    name: snr_r
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.flux_i'
    datatype: float
    description: An estimate of the i-band flux that comes out of the same fitting
      process as was used for the shapes. This should only be used as a diagnostic.
      For accurate, calibrated fluxes, users should use the flux values in the Gold
      catalogs.
    name: flux_i
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.mag_i'
    datatype: float
    description: An estimate of the i-band magnitude that comes out of the same fitting
      process as was used for the shapes. This should only be used as a diagnostic.
      For accurate, calibrated fluxes, users should use the flux values in the Gold
      catalogs.
    name: mag_i
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.t'
    datatype: float
    description: An estimate of the size, using the T = Ixx + Iyy definition of size,
      in arcsec^2. See Section 8.3.2 in Jarvis et al, 2015 for a description of the
      difference between T and T_R size estimates. In particular, the formula for
      T_R is Eqn. 8.4. It is recommended that any selection involving size beyond
      the cuts we have already applied should use T_R, not T.
    fits:tunit: arcsec^2
    name: t
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.t_err'
    datatype: float
    description: The estimated uncertainty in the estimate of T.
    name: t_err
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.t_r'
    datatype: float
    description: An estimate of the size that the object would have had if it were
      round. See Section 8.3.2 in Jarvis et al, 2015 for a description of the difference
      between T and T_R size estimates. In particular, the formula for T_R is Eqn.
      8.4. It is recommended that any selection involving size beyond the cuts we
      have already applied should use T_R, not T.
    name: t_r
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.snr_t'
    datatype: float
    description: The estimated S/N of T.
    name: snr_t
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.snr_t_r'
    datatype: float
    description: The estimated S/N of T_R.
    name: snr_t_r
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.log10_sb_i'
    datatype: float
    description: The base 10 logarithm of an estimate of the surface brightness of
      the object in units of (ADU / arcsec^2). This is a derived value, calculated
      as log10(abs(FLUX_I / T)).
    name: log10_sb_i
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.mean_psf_e1'
    datatype: double
    description: The mean measured ellipticity and size of the PSF for the different
      exposures that went into the shear estimates for this galaxy.
    name: mean_psf_e1
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.mean_psf_e2'
    datatype: double
    description: The mean measured ellipticity and size of the PSF for the different
