    name: mean_psf_t
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.sens_1'
    datatype: float
    description: The raw sensitivity estimate for E_1. We recommend using SENS_AVG,
      which is the average of SENS_1 and SENS_2, for both E_1 and E_2, rather than
      these individual estimates.
    name: sens_1
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.sens_2'
    datatype: float
    description: The raw sensitivity estimate for E_2. We recommend using SENS_AVG,
      which is the average of SENS_1 and SENS_2, for both E_1 and E_2, rather than
      these individual estimates.
    name: sens_2
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.arate'
    datatype: float
    description: Acceptance rate. Galaxies with 0.4 < ARATE < 0.6 are considered good.
    name: arate
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.stamp_size'
    datatype: int
    description: The size (in pixels) of the postage stamp images used for this galaxy.
    name: stamp_size
    nullable: true
    tap:principal: 0
    tap:std: 0
  - '@id': '#des_sva1.gold_ngmix.mask_frac'
    datatype: float
    description: The fraction of the pixels in all the postage stamps used for this
      galaxy that were masked for some reason (neighboring objects, dead pixels, bad
      columns, cosmic rays, etc.)
    name: mask_frac
    nullable: true
    tap:principal: 0
    tap:std: 0
