      this column is the following derived quantity: IM3SHAPE_FLAG = ~((ERROR_FLAG
      == 0) & (INFO_FLAG == 0) & (SNR_W > 15) & (MEAN_RGPP_RP > 1.2))'
    name: im3shape_flag
    nullable: true
    tap:principal: 0
