      cf. Section 9.1 and Appendix B. Using columns from the NGMix Catalog, this column
      is the following derived quantity: NGMIX_FLAG = ~((ERROR_FLAG == 0) & (0.4 <
      ARATE < 0.6) & (SENS_AVG > 0) & (SNR_R > 15) & (T_R / T_PSF > 0.15))'
    name: ngmix_flag
